CREATE TABLE mytable(
   age                     INTEGER  NOT NULL PRIMARY KEY 
  ,gender                  VARCHAR(6) NOT NULL
  ,bmi                     NUMERIC(4,1) NOT NULL
  ,alcohol_consumption     VARCHAR(10) NOT NULL
  ,smoking_status          VARCHAR(7) NOT NULL
  ,hepatitis_b             BIT  NOT NULL
  ,hepatitis_c             BIT  NOT NULL
  ,liver_function_score    NUMERIC(5,1) NOT NULL
  ,alpha_fetoprotein_level NUMERIC(6,2) NOT NULL
  ,cirrhosis_history       BIT  NOT NULL
  ,family_history_cancer   BIT  NOT NULL
  ,physical_activity_level VARCHAR(8) NOT NULL
  ,diabetes                BIT  NOT NULL
  ,liver_cancer            BIT  NOT NULL
);
